// Define a function to generate a random alphanumeric string of a given length
const generatePromoCode = (length) => {
  // Define the characters to be used in the promo code: only uppercase letters and numbers
  const characters = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789';
  let result = '';

  // Loop to generate the promo code
  for (let i = 0; i < length; i++) {
    // Select a random character from the characters string
    const randomIndex = Math.floor(Math.random() * characters.length);
    result += characters[randomIndex];
  }

  // Return the generated promo code
  return result;
};

// Generate a promo code of length 10
const promoCode = generatePromoCode(10);
return promoCode;

