// Function to generate a random UUIDv4
const generateUUIDv4 = () => {
    // Helper function to generate two random hex digits
    const hexDigits = () => Math.floor((1 + Math.random()) * 0x10000).toString(16).substring(1);

    // Create the UUIDv4 by combining hex digits
    return `${hexDigits()}${hexDigits()}-${hexDigits()}-${hexDigits().substr(0, 3)}4${hexDigits().substr(1, 3)}-${hexDigits().substr(0, 1)}${
        ['8', '9', 'a', 'b'][Math.floor(Math.random() * 4)]
    }${hexDigits().substr(1, 3)}-${hexDigits()}${hexDigits()}${hexDigits()}`;
};

return generateUUIDv4();
